import React from "react";

function Nav() {
    return (
        <nav className="h-20 w-screen bg-blue-300 flex justify-between">
            <div className="w-2/6 h-full bg-blue-600"></div>
            <div className="w-4/6 h-full bg-blue-900"></div>
        </nav>
    );
}

export default Nav;
